import React from 'react';

function Experiencies({experiencia, handleInscription}) {

    const {id, title, body, image, owner, xapes, data} = experiencia;

    const inscription = () => {
        handleInscription(id);
    }

    return (
        <div style = {row}>
            <div style = {column}>
            </div>
            <div style = {column}>
                <h1 style={mystyle}>{title}</h1>
                {body} <br/>
                {owner} <br/>
                {xapes} <br/>
                {data} <br/>
                {}

                </div>
            { /*<!-- Divider -->*/}
            <hr className="sidebar-divider d-none d-md-block"/>
        </div>
    );
}

const mystyle = {
    color: "orange",
    padding: "15px",
    fontSize: 25
};

const row = {
      display: "flex"
};

const column = {
    float: "left",
    width: "20%",
    padding: "10px"
};

export default Experiencies;
